import {useState} from 'react';
import './App.css';

function App() {

  const [darkMode, setDarkMode] = useState(false)
  return (
    <div className="App">
      <header className="App-header">
        <h1>{darkMode ? 'Dark Mode' : 'Light Mode'} </h1>
        <button onClick={()=> setDarkMode(!darkMode)}>
          Toggle Dark Mode
        </button>
      </header>
    </div>
  );
}

export default App;
